import logo from "./logo.svg";
import styles from "./App.module.css";
import Nav from "./components/Nav/Nav";
import Menu from "./components/Menu/Menu";

function App() {
  return (
    <div className={styles.App}>
      <Nav />
      <div className={styles.conatiner}>
        <Menu />
      </div>
    </div>
  );
}

export default App;
